//import logo from "./logo.svg";
import "./App.css";
import * as React from "react";
import CssBaseline from "@mui/material/CssBaseline";

import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import GridPage from "./components/GridPageContents/GridPage"
import TwentyQ from "./components/TwentyQ/TwentyQ"

function App() {
  const [open, setOpen] = React.useState(false);

  return (
    <div className="App">
      <link
        rel="stylesheet"
        href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap"
      />
      <link
        rel="stylesheet"
        href="https://fonts.googleapis.com/icon?family=Material+Icons"
      />
      <header className="App-header">
        <CssBaseline enableColorScheme /> 

        <BrowserRouter>
          <Routes>
            <Route path="/" element={<GridPage open={open} setOpen={setOpen}/>} />
            <Route path="movieList" element={<GridPage open={open} setOpen={setOpen}/>} />
            <Route path="twentyQ" element={<TwentyQ open={open} setOpen={setOpen}/>} />
            <Route path="account" element={<GridPage open={open} setOpen={setOpen}/>} />
          </Routes>
        </BrowserRouter>

      </header>
    </div>
  );
}

export default App;
